import React from "react";
import Message from "./message";
const messages = () => {
    return(
        <div className="messages">
            <Message/>
            <Message/>
            <Message/>
            <Message/>
            <Message/>
            <Message/>
            <Message/>
        </div>
    )
}

export default messages;
